eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   quizQuestions: () => (/* binding */ quizQuestions)\n/* harmony export */ });\nconst quizQuestions = [\n    {\n        \"id\": 1,\n        \"category\": \"Software Updates\",\n        \"question\": \"How often do you apply operating system updates to all PCs?\",\n        \"answers\": [\n            {\n                \"text\": \"A) As soon as updates are available.\",\n                \"points\": 10,\n                \"feedback\": \"Great job! Updating your systems as soon as updates are available is like locking your doors every nightit keeps hackers out by fixing security holes they could use to break in. Cybercriminals are always looking for outdated systems to exploit, like in the WannaCry attack of 2017, which hit businesses that hadnt updated in just a few weeks. By staying current, youre making it much harder for them to get in. To keep this habit strong:\\n\\n- **Enable Automatic Updates**: On Windows, go to Settings > Update & Security > Windows Update > Advanced Options and turn on 'Automatically download updates.' On a Mac, go to System Preferences > Software Update and check 'Automatically keep my Mac up to date.' This ensures updates happen without you lifting a finger.\\n- **Set Active Hours**: Avoid interruptions by setting update times for when youre not working. On Windows, in 'Windows Update,' click 'Change active hours' and pick something like 10 PM to 6 AM.\\n- **Check Monthly**: Set a calendar reminder for the first of each month to peek at your update history (Windows: 'View update history'; Mac: 'More info' in Software Update). If updates are recent, youre goldenif not, troubleshoot or call your internet provider.\\n\\nYoure already doing one of the smartest things to protect your business. Keep it up, and youll stay ahead of the bad guys!\"\n            },\n            {\n                \"text\": \"B) Every 1-3 months when I have time.\",\n                \"points\": 6,\n                \"feedback\": \"Youre making an effort, which is a good start, but waiting 1-3 months to update your systems is like leaving your shops back door unlocked for weekssomeones bound to notice and sneak in. Hackers move fast, often exploiting flaws within days of discovery. Take the WannaCry ransomware attack in 2017it locked up thousands of businesses worldwide because they hadnt updated their Windows systems in just a few weeks, costing millions. Updating only every few months leaves your business exposed to these kinds of attacks, and doing it manually 'when you have time' can easily slip when youre busy.\\n\\n**Steps to Fix This**:\\n1. **Switch to Automatic Updates**: Let your systems handle it. On Windows, click Start, type 'Settings,' go to 'Update & Security > Windows Update > Advanced Options,' and turn on 'Automatically download updates.' On a Mac, go to 'System Preferences > Software Update' and check 'Automatically keep my Mac up to date.'\\n2. **Set a Quiet Time**: Schedule updates for off-hours. On Windows, under 'Windows Update,' click 'Change active hours' and set 10 PM to 6 AM. Macs usually update overnight.\\n3. **Check Monthly**: Once a month, look at your update history (Windows: 'View update history'; Mac: 'More info' in Software Update) to ensure its working. If updates are old, troubleshoot or call your provider.\\n4. **Catch Up Now**: Manually check for updates todayclick 'Check for updates' in the same menu and install anything pending. It might take 15-20 minutes.\\n5. **Get Help if Stuck**: If this feels tricky, your internet provider or a local tech shop can set it up over the phone or in person.\\n\\nSwitching to automatic updates takes this off your plate and keeps your systems secure without the wait. Youve got this!\"\n            },\n            {\n                \"text\": \"C) Hardly ever, unless theres a problem or it forces me.\",\n                \"points\": 2,\n                \"feedback\": \"This approach is risky! Waiting until theres a problem or your computer forces an update is like ignoring a leaky roof until it rainsyoure already in trouble by then. Your operating system is the backbone of your digital security, and skipping updates leaves it wide open to hackers. For example, the Equifax breach in 2017 exposed 147 million peoples data because they didnt update software for months after a fix was availableit was a disaster they couldve avoided. Ransomware doesnt wait for 'someday'it locks files and demands payment daily. If you only update when forced, youre an easy target, and a problem might mean youve already been hit.\\n\\n**Steps to Fix This**:\\n1. **Turn On Automatic Updates**: Do it nowon Windows, go to Settings > Update & Security > Windows Update > Advanced Options and enable 'Automatically download updates.' On a Mac, System Preferences > Software Update > check 'Automatically keep my Mac up to date.'\\n2. **Schedule It**: Set updates for off-hours. On Windows, use 'Change active hours' to pick midnight to 8 AM. Macs handle it overnight.\\n3. **Check Now**: Go to 'Windows Update' or 'Software Update,' click 'Check for updates,' and install anything waitingsave your work first, as it might restart.\\n4. **Monitor Monthly**: Set a reminder to glance at your update history monthly. If its not current, fix it or call for help.\\n5. **Ask for Support**: If this feels overwhelming, your internet providers support line (usually free) or a tech shop can walk you through it.\\n\\nTaking these steps turns your systems from sitting ducks into tough targets. Its easier than you think, and youll feel much safer!\"\n            },\n            {\n                \"text\": \"D) Im not sure.\",\n                \"points\": 0,\n                \"feedback\": \"Not knowing how often your systems update is like driving without checking your brakesyou might be fine, or you might be at risk. Updates are your first line of defense against cyberattacks, and uncertainty often means gaps hackers can exploit. The good news? Its simple to find out and fix!\\n\\n**Steps to Fix This**:\\n1. **Check Your Settings**: On Windows, go to Settings > Update & Security > Windows Updatelook for 'Last checked' or 'Update history.' If its over a week old, updates might not be automatic. On a Mac, System Preferences > Software Update will say if youre up to date.\\n2. **Enable Automatic Updates**: If theyre off, turn them onWindows: 'Advanced Options > Automatically download updates'; Mac: 'Automatically keep my Mac up to date.'\\n3. **Ask for Help**: If you have an IT person, call and ask, 'Are our systems set to update automatically?' If not, have them fix it.\\n4. **Take Charge**: If you manage your own PCs, set a monthly reminder to check update history and ensure its working.\\n\\nGetting a handle on updates is like locking your doors at nighta small step with big protection. Take a few minutes today to check, and youll rest easier knowing your business is safer.\"\n            }\n        ]\n    },\n    {\n        \"id\": 2,\n        \"category\": \"Software Updates\",\n        \"question\": \"Do you update apps like Acrobat Reader, Chrome, or Zoomnot just the operating system?\",\n        \"answers\": [\n            {\n                \"text\": \"A) As soon as updates are available.\",\n                \"points\": 10,\n                \"feedback\": \"Excellent choice! Keeping all your apps updated is like locking every window in your househackers often sneak in through outdated software, not just the operating system. Apps like Chrome or Zoom can have security flaws too, and staying current shuts those doors tight. For example, Zoom fixed a flaw in 2020 that let hackers crash meetingsupdates stopped it cold. To keep this smooth:\\n\\n- **Enable Auto-Updates**: For Chrome, it updates itselfcheck by clicking the three dots > Help > About Google Chrome. For Zoom, go to Settings > General and check 'Automatically keep Zoom up to date.' Adobe Reader: Help > Check for Updates > set to automatic.\\n- **Use a Tool**: Try Ninite (search 'Ninite')its free and updates multiple apps in one go.\\n- **Check Quarterly**: Set a reminder every 3 months to ensure all apps are current and auto-updates are working.\\n\\nYoure doing a fantastic job keeping your business securekeep it up, and youll stay one step ahead!\"\n            },\n            {\n                \"text\": \"B) Every 1-3 months when I remember.\",\n                \"points\": 6,\n                \"feedback\": \"Youre trying, which is good, but updating apps every 1-3 months is like leaving your windows cracked opensomeone might spot the gap and climb in. Hackers target outdated apps because theyre easier to crack, like the Zoom flaw in 2020 that let intruders join calls until an update fixed it. Waiting months and doing it 'when you remember' risks missing critical fixes when youre busy.\\n\\n**Steps to Fix This**:\\n1. **Turn On Auto-Updates**: For Chrome, its automaticjust confirm in 'About Google Chrome.' For Zoom, Settings > General > 'Automatically keep Zoom up to date.' Adobe Reader: Help > Check for Updates > enable automatic.\\n2. **Set a Reminder**: If auto-updates arent an option, set a monthly calendar alert to check each app manuallylook for 'Check for updates' in their menus.\\n3. **Use Ninite**: Download it from ninite.com (free) and run it monthly to update multiple apps at once.\\n4. **Clean Up**: Uninstall apps you dont useon Windows, Settings > Apps; on Mac, drag to Trash.\\n5. **Ask for Help**: If this feels tricky, a tech-savvy friend or your IT provider can set up auto-updates for you.\\n\\nAutomating this keeps your apps secure without the hasslegive it a shot, and youll feel the difference!\"\n            },\n            {\n                \"text\": \"C) Only when the app prompts me or theres a problem.\",\n                \"points\": 2,\n                \"feedback\": \"This is risky! Waiting for prompts or problems is like waiting for your smoke alarm to blare before checking for fireit might be too late. Many apps dont nag you to update, and even if they do, you might miss it. Hackers exploit outdated apps fastlike Adobe Reader flaws that let them take over PCs until updates patched them. If you only update when theres a problem, you could already be compromised.\\n\\n**Steps to Fix This**:\\n1. **Enable Auto-Updates**: Check each appChrome updates itself, Zoom has a setting under General, Adobe Reader under Help > Check for Updates.\\n2. **Check Monthly**: For apps without auto-updates, set a reminder to manually checkopen them and look for 'Update' options.\\n3. **Use Ninite**: Grab it from ninite.comit updates many apps with one click. Run it monthly.\\n4. **Remove Extras**: Uninstall unused apps to shrink your riskWindows: Settings > Apps; Mac: drag to Trash.\\n5. **Get Support**: If this feels overwhelming, your IT provider or a tech friend can set it up in minutes.\\n\\nTaking control of app updates is like locking all your windowsits a small effort that pays off big. Start today, and youll be much safer!\"\n            },\n            {\n                \"text\": \"D) Im not sure.\",\n                \"points\": 0,\n                \"feedback\": \"Not knowing if your apps are updated is like having a security system but not checking if its onyou might be safe, or you might be vulnerable. Apps are hacker targets too, and without updates, theyre easy to break into. The fix is quick and simple!\\n\\n**Steps to Fix This**:\\n1. **Check Your Apps**: Open key ones (Chrome, Zoom, Adobe Reader) and look for 'About' or 'Check for updates'install anything pending.\\n2. **Turn On Auto-Updates**: Chrome does it itself; Zoom: Settings > General > 'Automatically update'; Adobe: Help > set to automatic.\\n3. **Use Ninite**: Download it from ninite.com to manage updates for many apps at oncerun it monthly.\\n4. **Ask IT**: If you have an IT person, ask, 'Are our apps updating automatically?' If not, have them fix it.\\n5. **Take Charge**: Set a quarterly reminder to ensure all apps are current.\\n\\nGetting a grip on app updates is like making sure all your doors are lockeda little check goes a long way. Dive in today, and youll boost your security fast!\"\n            }\n        ]\n    },\n    {\n        \"id\": 3,\n        \"category\": \"User Authentication\",\n        \"question\": \"How does your business store passwords for accounts and systems?\",\n        \"answers\": [\n            {\n                \"text\": \"A) We use a secure password manager or vault.\",\n                \"points\": 10,\n                \"feedback\": \"Fantastic! Using a password manager is like having a top-notch safe for your keysit keeps passwords secure and helps you make them super-strong. Hackers cant easily crack a good manager, and it stops risky habits like reusing passwords. To make this even better:\\n\\n- **Strengthen Your Master Password**: Make it long and unique (e.g., 'MyCatLoves2NapInTheSun!')its the only one youll need to remember.\\n- **Enable Two-Factor Authentication (2FA)**: In your password managers settings, turn on 2FA for an extra lockitll send a code to your phone.\\n- **Share Securely**: Use the managers 'share' feature (e.g., LastPass Sharing Center) instead of emailing passwords.\\n- **Check Yearly**: Review your stored passwords annually to remove old accounts.\\n\\nYoure doing an awesome job keeping your business locked tightkeep it up, and youre golden!\"\n            },\n            {\n                \"text\": \"B) We write them down or save them in a file on the computer.\",\n                \"points\": 4,\n                \"feedback\": \"This is risky! Writing passwords down or saving them in a filelike a Word doc or spreadsheetis like hiding your keys under the doormat. If someone gets into your office, they could snatch that paper list. Worse, if a hacker gets into your computer (via phishing or outdated software), theyd hit the jackpot with that fileaccess to banking, email, everything. In 2019, a medical practice got hacked because an employees password list was in a desktop file; patient data was stolen, and it was a mess. Even trusted staff could accidentally misuse it, and paper or files dont help you create strong passwordstheyre often weak and reused.\\n\\n**Steps to Fix This**:\\n1. **Get a Password Manager**: Download a free one like Bitwarden or LastPass (search 'Bitwarden download')its quick to install.\\n2. **Set It Up**: Create a master passwordlong and memorable (e.g., 'MyDogRuns2Fast!'). Write it down temporarily and lock it away until memorized.\\n3. **Transfer Passwords**: Open your list or file, log into each account, and use the managers 'generate password' to make a new one (e.g., 'P7!kQz9$mL2'). Save it in the manager.\\n4. **Delete Old Records**: Shred paper lists. For files, right-click > Delete, then empty Recycle Bin (Windows) or Trash (Mac).\\n5. **Share Smart**: Use the managers 'share' feature for team accessno more emails.\\n6. **Add 2FA**: In the managers settings, enable two-factor authentication for extra safety.\\n\\nSwitching to a password manager is like upgrading to a vaultits safer and simpler. Youll love how easy it makes things!\"\n            },\n            {\n                \"text\": \"C) We remember them or share them via email or messages.\",\n                \"points\": 0,\n                \"feedback\": \"This is a big red flag! Relying on memory leads to weak, reused passwordslike 'password123' everywherebecause strong ones are hard to recall. Hackers love this; if they crack one account, theyve got them all. Sharing via email or messages is even worseits like yelling your PIN in a crowd. Emails can be intercepted, and messages arent secure. In 2020, a business lost their social media because an employee shared a password via WhatsApp, and a hacker grabbed it. This setup is a hackers dream.\\n\\n**Steps to Fix This**:\\n1. **Get a Password Manager**: Download Bitwarden or LastPass for freeits your new password vault.\\n2. **Generate Strong Passwords**: For each account, use the manager to create a unique one (e.g., 'X9!pQz7$kM2') and save it.\\n3. **Stop Unsafe Sharing**: Never email or message passwordsuse the managers 'share' feature or hand-deliver on paper (then shred).\\n4. **Add 2FA**: For key accounts (email, banking), enable two-factor authentication in security settingsits like a deadbolt.\\n5. **Train Your Team**: Share this risk with employeesshow them how to use the manager with a test account.\\n\\nMaking these changes locks down your accounts tightits a quick fix with huge payoff. You can do this!\"\n            },\n            {\n                \"text\": \"D) I dont know.\",\n                \"points\": 2,\n                \"feedback\": \"Not knowing how passwords are stored is like not knowing if your shops lockedyou might be okay, or you might be exposed. Passwords are your digital keys, and if theyre not handled safely, hackers could stroll in. The good news? Its easy to check and fix!\\n\\n**Steps to Fix This**:\\n1. **Ask Your Team**: 'How do we store passwords?' If its paper or files, see B; if its a manager, great!\\n2. **Check Your PC**: Look for a 'passwords' file or sticky notesif you find them, its time to change.\\n3. **Get a Password Manager**: Download Bitwarden or LastPass and start using itset a strong master password.\\n4. **Set a Rule**: Tell your team, 'Use the password manager for all work accountsno exceptions.'\\n5. **Get Help**: If unsure, call a tech friend or IT provider to set it up.\\n\\nTaking control of password storage is like securing your keys in a safea small step with big protection. Check it out today, and youll feel more secure!\"\n            }\n        ]\n    },\n    {\n        \"id\": 4,\n        \"category\": \"User Authentication\",\n        \"question\": \"Do you use strong, unique passwords for every account?\",\n        \"answers\": [\n            {\n                \"text\": \"A) Yes, all accounts have strong, unique passwords.\",\n                \"points\": 10,\n                \"feedback\": \"Awesome work! Using strong, unique passwords for every account is like having a different, unbreakable lock on every doorhackers cant use one key to open everything. Aim for at least 12 characters with letters, numbers, and symbols (e.g., 'R3kord!2023'). To keep this solid:\\n\\n- **Use a Password Manager**: Tools like Bitwarden or LastPass generate and store these for youfree and easy.\\n- **Enable 2FA**: Add two-factor authentication to key accounts (email, banking) in their security settingsits like a second lock.\\n- **Review Yearly**: Check your passwords annually to ensure theyre still strong and unique.\\n\\nYoure nailing one of the best ways to protect your businesskeep it up, and youre in great shape!\"\n            },\n            {\n                \"text\": \"B) Some accounts share passwords, but theyre strong.\",\n                \"points\": 4,\n                \"feedback\": \"Youre halfway there, but sharing passwords across accounts is like using the same key for your house and carif someone steals it, theyve got both. Hackers use 'credential stuffing,' trying leaked passwords from one site on others. In 2019, a businesss email was hacked because the owner reused a strong password from a breached LinkedIn account. Even strong passwords lose their power if reused.\\n\\n**Steps to Fix This**:\\n1. **List Shared Passwords**: Identify which accounts share passwordsfocus on email, banking, customer data.\\n2. **Change Them**: Start with emaillog in, go to security settings, and use a password manager to generate a new one (e.g., 'K9!pQz7$mL2').\\n3. **Get a Password Manager**: Download Bitwarden or LastPass to keep them unique and secure.\\n4. **Add 2FA**: Enable two-factor authentication on changed accounts for extra protection.\\n5. **Fix Gradually**: Change one password a week until theyre all uniqueits manageable!\\n\\nMaking each password unique builds separate walls around your accountsone breach wont topple them all. Youve got this!\"\n            },\n            {\n                \"text\": \"C) No, we reuse the same password a lot.\",\n                \"points\": 0,\n                \"feedback\": \"This is a high-risk habit! Reusing passwords is like using one key for everythingif hackers get it, theyve got your whole business. They use leaked passwords from one site to crack others, a trick that hit a small retailer in 2020they lost thousands when a reused password let hackers into their payment system. Its a common trap, but easy to escape!\\n\\n**Steps to Fix This**:\\n1. **Start with Key Accounts**: Change email, banking, and admin passwords firstmake them unique and strong (12+ characters).\\n2. **Use a Password Manager**: Download Bitwarden or LastPass to generate and store new ones (e.g., 'X7!pQz9$kM2').\\n3. **Change Slowly**: Do one a day or week until all are uniquedont rush.\\n4. **Add 2FA**: Turn on two-factor authentication in account settingsits a lifesaver.\\n5. **Tell Your Team**: If employees reuse passwords, get them on the manager too.\\n\\nSwitching to unique passwords is like upgrading your locksit takes a bit of time but keeps everything safer. Start today, and youll see the difference!\"\n            },\n            {\n                \"text\": \"D) I dont know.\",\n                \"points\": 2,\n                \"feedback\": \"Not knowing if your passwords are strong and unique is like not checking your locksyou might be secure, or you might not. Weak or reused passwords are a top way hackers break in, but its simple to find out and fix!\\n\\n**Steps to Fix This**:\\n1. **Check Key Accounts**: Think about email, banking, social mediaare they different? Long and complex?\\n2. **Use a Password Manager**: Download Bitwarden or LastPassit can scan for weak or reused passwords.\\n3. **Update Weak Ones**: Start with emailmake it unique and strong, then move to others.\\n4. **Add 2FA**: Enable two-factor authentication on all accounts that offer it.\\n5. **Ask Employees**: If they manage accounts, check if theyre reusing passwordsget them on the manager.\\n\\nTaking control of your passwords is like securing every doora quick check makes a big difference. Dive in today, and youll boost your security fast!\"\n            }\n        ]\n    },\n    {\n        \"id\": 5,\n        \"category\": \"Multi-Factor Authentication (MFA)\",\n        \"question\": \"Do you use an extra security step (like a phone code) for online accounts?\",\n        \"answers\": [\n            {\n                \"text\": \"A) Yes, for all key accounts like email and banking.\",\n                \"points\": 10,\n                \"feedback\": \"Terrific! Using an extra security step, like a phone code, is like having a bouncer check IDsit stops hackers even if they guess your password. This is two-factor authentication (2FA), and its a game-changer. To keep it rock-solid:\\n\\n- **Verify Coverage**: Ensure 2FA is on for all critical accountsemail, banking, cloud storage, admin logins.\\n- **Use an App**: Switch to an authenticator app like Google Authenticator (download from your app store)its safer than SMS.\\n- **Backup Codes**: Save backup codes from each account in a secure spot (like your password manager) in case your phones unavailable.\\n- **Check Yearly**: Confirm 2FA is still active annually.\\n\\nYoure doing an amazing job locking down your accountskeep it up, and youre well-protected!\"\n            },\n            {\n                \"text\": \"B) Yes, but only for some accounts.\",\n                \"points\": 4,\n                \"feedback\": \"Good start, but leaving some accounts without 2FA is like locking your front door but not the backhackers can still sneak in. Email is a prime target; if its unprotected, they can reset other passwords. In 2018, a business lost customer data because their email lacked 2FA, letting a hacker take over.\\n\\n**Steps to Fix This**:\\n1. **Secure Email First**: Log into your email (e.g., Gmail: Settings > Security > 2-Step Verification) and turn on 2FAlink your phone.\\n2. **Add to Banking**: Check your banks security settings and enable 2FA.\\n3. **Cover Cloud/Admin**: For Dropbox, Google Drive, or admin accounts, turn on 2FA in their security settings.\\n4. **Use an App**: Download Google Authenticator for safer codes than SMS.\\n5. **Set a Reminder**: Check every 6 months to ensure 2FA is on everywhere.\\n\\nAdding 2FA to all key accounts makes it way harder for hackers to break inyoure almost there!\"\n            },\n            {\n                \"text\": \"C) No, we just use passwords.\",\n                \"points\": 0,\n                \"feedback\": \"This is risky! Relying only on passwords is like using a cheap lockhackers can pick it if they guess or steal it. Passwords alone arent enough; in 2021, a business lost their database because a hacker guessed an employees password with no 2FA to stop them. Its an easy fix, though!\\n\\n**Steps to Fix This**:\\n1. **Start with Email**: For Gmail, go to Settings > Security > 2-Step Verification and set it up. For Outlook, Security > 'Two-step verification.'\\n2. **Add to Banking**: Log into your bank, find security settings, and enable 2FA.\\n3. **Secure Other Accounts**: Turn it on for cloud storage, social media, anything sensitive.\\n4. **Use an App**: Get Google Authenticator or Authysafer than texts.\\n5. **Tell Your Team**: Ensure employees enable 2FA on work accounts.\\n\\nAdding 2FA is like installing a deadboltits quick and makes a huge difference. Get started today, and youll sleep better!\"\n            },\n            {\n                \"text\": \"D) Im not sure.\",\n                \"points\": 2,\n                \"feedback\": \"Not knowing if you use 2FA is like not checking if your alarms setyou might be safe, or you might not. Two-factor authentication is a must-have to stop hackers, even if they have your password. Its easy to find out!\\n\\n**Steps to Fix This**:\\n1. **Check Your Accounts**: Log into email, banking, etc., and look under 'Security' for 'Two-Factor Authentication' or '2-Step Verification.'\\n2. **Turn It On**: If its off, set it uplink your phone or use Google Authenticator.\\n3. **Ask IT**: If you have an IT person, ask, 'Do we use 2FA on key accounts?' If not, get it done.\\n4. **Make It Standard**: For new accounts, always enable 2FA right away.\\n\\nChecking and enabling 2FA is a small step with big protectionlike locking a second bolt. Take a look today, and youll be safer in no time!\"\n            }\n        ]\n    },\n    {\n        \"id\": 6,\n        \"category\": \"Backing Up Your Data\",\n        \"question\": \"Do you regularly save copies of important files in a safe place, like an external drive or cloud?\",\n        \"answers\": [\n            {\n                \"text\": \"A) Yes, all data is backed up automatically and stored safely offsite.\",\n                \"points\": 10,\n                \"feedback\": \"Outstanding! Automatic, offsite backups are like a fireproof safe for your businesss lifelineit protects against ransomware, crashes, or physical disasters. To keep this top-notch:\\n\\n- **Follow 3-2-1**: Keep 3 copies (original + 2 backups), on 2 different media (e.g., drive + cloud), with 1 offsite (cloud or another location).\\n- **Test Yearly**: Restore a few files annually to ensure backups worktry a customer list or old email.\\n- **Use Encryption**: For cloud services like Google Drive or Backblaze, enable encryption in settings for extra safety.\\n- **Update Plans**: Review your backup setup yearly or after big changes (new PCs, software).\\n\\nYoure doing an incredible job safeguarding your datakeep it up, and youre ready for anything!\"\n            },\n            {\n                \"text\": \"B) Yes, but only critical files, and backups stay onsite.\",\n                \"points\": 4,\n                \"feedback\": \"Youre on the right path, but backing up only critical files onsite is like keeping a spare key under a rock in your yardits handy until a fire or theft wipes out everything. If your office floods or gets hit by ransomware, those backups could vanish with your main data. Missing non-critical files like emails or projects could still hurt too.\\n\\n**Steps to Fix This**:\\n1. **Expand Coverage**: Back up all important datacustomer records, financials, emails, projects.\\n2. **Go Offsite**: Sign up for a cloud service like Google Drive or Backblaze (search 'Backblaze business')set it to back up key folders automatically.\\n3. **Keep a Drive**: Buy a 1TB external drive (~$50), plug it in weekly, and copy your datastore it in a locked cabinet.\\n4. **Test It**: Try restoring a file from your drive or cloud to confirm it works.\\n5. **Schedule Checks**: Set a quarterly reminder to ensure backups are running.\\n\\nAdding offsite backups and full coverage ensures you can recover from anythingits a small tweak with big peace of mind!\"\n            },\n            {\n                \"text\": \"C) No, we dont back up our files or systems.\",\n                \"points\": 0,\n                \"feedback\": \"This is dangerous! No backups is like driving without a spare tirea flat leaves you stuck. Cyberattacks, hardware failures, or accidental deletions can erase your data forever. In 2020, an accounting firm lost years of records to ransomware with no backupsthey paid thousands and still lost some data. Its an easy fix, though!\\n\\n**Steps to Fix This**:\\n1. **Start with Cloud**: Sign up for Google Drive, Dropbox, or Backblazeinstall the app and select key folders to back up.\\n2. **Set to Auto**: In the app, choose 'continuous backup' for real-time saves.\\n3. **Add a Drive**: Get an external hard drive, plug it in weekly, and copy your datastore it safely.\\n4. **Cover All Devices**: Back up every work computer and phone.\\n5. **Test It**: After setup, restore a file to check it works.\\n\\nSetting up backups is like buying insuranceit takes a little effort but saves you big when trouble hits. Start today, and youll be covered!\"\n            },\n            {\n                \"text\": \"D) Someone else handles itI dont know details.\",\n                \"points\": 2,\n                \"feedback\": \"Not knowing about your backups is like trusting a friend to lock your shop without checkingyou hope its done, but youre not sure. Backups are your lifeline, and if theyre not right, you could lose everything in a crisis.\\n\\n**Steps to Fix This**:\\n1. **Ask Questions**: Call your IT person'Are backups automatic? Offsite? Tested lately?' Vague answers are a red flag.\\n2. **Verify Yourself**: If using cloud (e.g., Google Drive), log incheck if files are recent.\\n3. **Set Up Your Own**: If unsure, use Backblaze or Dropbox for key foldersits simple.\\n4. **Demand Updates**: Ask for a monthly backup status report from whoever handles it.\\n\\nKnowing your backups are solid is like ensuring your safety nets tied tighttake a few minutes to check, and youll rest easier!\"\n            }\n        ]\n    },\n    {\n        \"id\": 7,\n        \"category\": \"Backing Up Your Data\",\n        \"question\": \"How often do you test your backups by trying to restore files?\",\n        \"answers\": [\n            {\n                \"text\": \"A) Every 6 months on a schedule.\",\n                \"points\": 10,\n                \"feedback\": \"Great work! Testing backups every 6 months is like checking your smoke detectorsyoure ensuring theyll save you when it counts. Backups can fail quietly, and regular tests catch issues early. To make this even better:\\n\\n- **Keep a Log**: Note what you tested, if it worked, and any fixesuse a simple spreadsheet or notebook.\\n- **Test After Changes**: Try a restore after major updates (new software, PCs) to confirm compatibility.\\n- **Involve Your Team**: Let key staff know the schedule so theyre ready if youre not around.\\n\\nYoure doing a stellar job keeping your safety net strongkeep it up, and youre set for any storm!\"\n            },\n            {\n                \"text\": \"B) Once a year or when we remember.\",\n                \"points\": 4,\n                \"feedback\": \"Youre doing something, which beats nothing, but testing only yearly or 'when you remember' is like checking your cars oil once in a blue moonyou might miss a problem until its too late. A law firm found this out the hard way when a crash revealed corrupted backups they hadnt tested in over a year. Infrequent checks leave you guessing.\\n\\n**Steps to Fix This**:\\n1. **Set a Schedule**: Add reminders for January 1 and July 1 to test backups.\\n2. **Pick Key Files**: Restore a customer list or financial file to a test folder.\\n3. **Verify Them**: Open the filesare they intact and readable?\\n4. **Log It**: Write down what you tested and if it workedfix issues if they arise.\\n5. **Ask for Help**: If your IT person manages backups, have them test and report every 6 months.\\n\\nTesting twice a year ensures your backups are ready when you need themits a quick task with big payoff!\"\n            },\n            {\n                \"text\": \"C) Neverwe restore only when something breaks.\",\n                \"points\": 2,\n                \"feedback\": \"This is risky! Never testing backups is like owning a lifeboat but not checking for holesyou wont know its useless until youre sinking. A retailer lost a year of sales data because untested backups failed during a crash. Waiting until disaster strikes is too late.\\n\\n**Steps to Fix This**:\\n1. **Test Now**: Restore a few files (e.g., an invoice) from your backup to a test folder.\\n2. **Check Them**: Open themare they good? If not, fix the backup system.\\n3. **Schedule It**: Set reminders for every 6 months to test again.\\n4. **Involve IT**: If someone else handles backups, ask them to test and confirm.\\n5. **Make It Routine**: Treat it like a fire drillsimple but essential.\\n\\nTesting backups is a small step that can save your businesstry it today, and youll know youre covered!\"\n            },\n            {\n                \"text\": \"D) Im not sure.\",\n                \"points\": 0,\n                \"feedback\": \"Not knowing if backups are tested is like having a spare tire but not checking if its flatyou might be set, or you might be in trouble. Untested backups can fail when you need them most.\\n\\n**Steps to Fix This**:\\n1. **Ask IT**: If someone manages backups, call'When did we last test them?'\\n2. **Test Yourself**: Pick a file and restore it to a test folderdoes it work?\\n3. **Set a Schedule**: If tests arent regular, start nowevery 6 months.\\n4. **Log Results**: Note what you tested and if it succeeded.\\n5. **Get Help**: If unsure, your IT provider can test and set a routine.\\n\\nConfirming your backups work is like testing your brakesa quick check for big safety. Find out today, and youll be ready!\"\n            }\n        ]\n    },\n    {\n        \"id\": 8,\n        \"category\": \"Cyber Security Training\",\n        \"question\": \"Does your team get regular cybersecurity training, online or in-person?\",\n        \"answers\": [\n            {\n                \"text\": \"A) Yes, everyone gets trained yearly.\",\n                \"points\": 10,\n                \"feedback\": \"Excellent! Yearly cybersecurity training is like giving your team a playbook to dodge digital trapsit helps them spot scams and keep your business safe. To make it even stronger:\\n\\n- **Run Phishing Tests**: Use a free tool like GoPhish to send fake phishing emailssee who clicks and train them extra.\\n- **Update Content**: Refresh training yearly with new threats (e.g., AI scams, remote work risks).\\n- **Make It Fun**: Add a quiz or prize for spotting trickskeeps it engaging.\\n\\nYoure building a sharp, aware teamkeep it up, and youll stay ahead of the game!\"\n            },\n            {\n                \"text\": \"B) Some training happens, but not for all or regularly.\",\n                \"points\": 4,\n                \"feedback\": \"Youre trying, but spotty training is like having a leaky roofsome areas stay dry, but others get soaked. Untrained staff are prime targets for phishing or scams. In 2019, a business lost $50,000 because an untrained employee fell for a fake invoice email.\\n\\n**Steps to Fix This**:\\n1. **Make It Mandatory**: Require training for all employees, including new hires.\\n2. **Set a Date**: Schedule a yearly sessionblock an hour in January.\\n3. **Use Free Tools**: Try Googles Be Internet Awesome or Microsofts Security Awareness Toolkitsimple and free.\\n4. **Test Them**: Send a fake phishing email (via GoPhish) and train anyone who clicks.\\n5. **Add Refreshers**: Share a 10-minute video every 6 months on new scams.\\n\\nTraining everyone regularly builds a human shieldits easier than you think and pays off big!\"\n            },\n            {\n                \"text\": \"C) No, we dont do training.\",\n                \"points\": 0,\n                \"feedback\": \"This is a big gap! No training is like sending your team into a game without rulesthey wont know how to defend. Human error causes 90% of breaches, often because staff miss threats like phishing. A clinic paid ransom after an employee clicked a bad linkno training meant no defense.\\n\\n**Steps to Fix This**:\\n1. **Start Easy**: Use Googles Phishing Quiz or Microsofts Security videosfree and quick.\\n2. **Hold a Session**: Schedule an hour for your team to watch or play together.\\n3. **Gamify It**: Who can spot the most fakes? Make it fun!\\n4. **Set a Rule**: 'If an email looks weird, dont clickask someone.'\\n5. **Repeat Yearly**: Calendar it for next year too.\\n\\nTraining is like teaching your team to lock upits simple, fast, and saves trouble. Start today, and youll see the difference!\"\n            },\n            {\n                \"text\": \"D) Im not sure.\",\n                \"points\": 2,\n                \"feedback\": \"Not knowing about training is like not checking if your team knows the fire exitsyou hope they do, but its a gamble. Without training, they might miss threats like phishing emails.\\n\\n**Steps to Fix This**:\\n1. **Ask Them**: 'Have you had cybersecurity training?' If no, its time.\\n2. **Use Free Resources**: Send them to Googles Be Internet Awesome or a short video.\\n3. **Make It Policy**: Require training for all, starting with new hires.\\n4. **Lead the Way**: Take it yourself firstshow it matters.\\n\\nA little training goes a long wayits like teaching your team to spot fakes. Check it out today, and youll be safer!\"\n            }\n        ]\n    },\n    {\n        \"id\": 9,\n        \"category\": \"Controlling Access to Information\",\n        \"question\": \"Do you limit who can see certain info based on their job?\",\n        \"answers\": [\n            {\n                \"text\": \"A) Yes, staff only see what they need for their role.\",\n                \"points\": 10,\n                \"feedback\": \"Perfect! Limiting access by job role is like giving employees keys only to their work areasit cuts the risk of leaks or mistakes. This least privilege approach is a security gold standard. To keep it tight:\\n\\n- **Review Every 6 Months**: Check who has access, especially after staff changes.\\n- **Use Groups**: In systems like Google Workspace, set permissions by role (e.g., 'Managers,' 'Staff')its easier.\\n- **Train Staff**: Remind them why it mattersOnly access what you need.\\n\\nYoure doing a fantastic job keeping data where it belongskeep it up, and youre solid!\"\n            },\n            {\n                \"text\": \"B) Yes, for some systems, but not always enforced.\",\n                \"points\": 4,\n                \"feedback\": \"Good effort, but loose access controls are like locking some doors and not otherstrouble can slip through. If limits arent consistent, sensitive data could leak. A business lost client files because an ex-employees access wasnt cut off properly.\\n\\n**Steps to Fix This**:\\n1. **Audit Access**: List your systems (email, cloud, databases)who can see what?\\n2. **Define Roles**: Set rulese.g., only accountants see financials, only HR sees staff files.\\n3. **Adjust Settings**: In Google Workspace, Admin > Users > adjust app access. For drives, right-click folders > Properties > Security.\\n4. **Check Regularly**: Every 6 months, review accesscut extras.\\n5. **Get Help**: If you have IT, ask them to tighten it up.\\n\\nEnforcing access limits keeps data safeits a quick tweak with big impact!\"\n            },\n            {\n                \"text\": \"C) No, everyone can see everything.\",\n                \"points\": 0,\n                \"feedback\": \"This is a big risk! Open access is like leaving your safe unlockedanyone can grab whats inside. Hackers love this; one breached account gets them everything. A business lost a client when an employee accidentally emailed pricing to a competitorno limits meant no control.\\n\\n**Steps to Fix This**:\\n1. **Spot Sensitive Data**: Customer info, financials, HR fileswhat needs protecting?\\n2. **Set Roles**: Decide who needs whate.g., sales sees contacts, not payroll.\\n3. **Lock It Down**: In shared drives, right-click > Properties > Security > Edit permissions. In email systems, adjust user rights.\\n4. **Use Groups**: Group users (e.g., Finance) and assign access.\\n5. **Tell Your Team**: Explain whyLess access, less risk.\\n\\nLimiting access is like locking cabinetsit takes a bit of setup but keeps your secrets safe. Start today!\"\n            },\n            {\n                \"text\": \"D) Im not sure.\",\n                \"points\": 2,\n                \"feedback\": \"Not knowing who can access what is like not tracking who has your keysyou might be fine, or you might be exposed. Uncontrolled access risks leaks or breaches.\\n\\n**Steps to Fix This**:\\n1. **Check Systems**: Log into email, cloud, etc.look at user permissions.\\n2. **Ask IT**: Do we limit access by role? If not, set it up.\\n3. **Define Limits**: Follow Cs steps to restrict access by job.\\n4. **Make It Rule**: Only access what your job needs.\\n\\nGetting a handle on access is like securing your vaulta small check makes a big difference. Dive in today!\"\n            }\n        ]\n    },\n    {\n        \"id\": 10,\n        \"category\": \"Managing Applications\",\n        \"question\": \"Do you only allow apps your business needs, blocking or removing extras?\",\n        \"answers\": [\n            {\n                \"text\": \"A) Yes, only needed apps are allowedextras are gone.\",\n                \"points\": 10,\n                \"feedback\": \"Spot on! Keeping only essential apps is like keeping your desk clearit cuts clutter and risk. Unused apps can be hacker targets if outdated. To stay sharp:\\n\\n- **Review Quarterly**: Every 3 months, check for unused appsuninstall them.\\n- **Auto-Update**: Ensure kept apps update automatically (e.g., Chrome does; others check settings).\\n- **Use Tools**: For multiple devices, try Microsoft Intune to enforce this.\\n\\nYoure doing a great job minimizing threatskeep it lean and mean!\"\n            },\n            {\n                \"text\": \"B) Mostly, but some unused apps stick around.\",\n                \"points\": 4,\n                \"feedback\": \"Youre close, but unused apps lingering is like keeping old junk in your garageit might trip you up. Hackers exploit outdated apps, like in the 2017 NotPetya attack that hit via old accounting software.\\n\\n**Steps to Fix This**:\\n1. **List Apps**: On each PC, Settings > Apps (Windows) or Applications (Mac)whats there?\\n2. **Ditch Unused**: If its not used in 3 months, uninstallright-click > Uninstall or drag to Trash.\\n3. **Update Keepers**: Check auto-update is on for apps you need.\\n4. **Set Rules**: Only install work appstell your team.\\n5. **Use CCleaner**: Download it (free) to spot and remove extras.\\n\\nCleaning up apps shrinks your risksits a quick sweep with big benefits!\"\n            },\n            {\n                \"text\": \"C) No, we dont manage apps.\",\n                \"points\": 0,\n                \"feedback\": \"This is risky! Unmanaged apps are like leaving tools out in the opensomeone could misuse them. Old apps like Java or Flash are hacker favorites for their holes.\\n\\n**Steps to Fix This**:\\n1. **Audit Apps**: Check Settings > Apps on each devicewhats installed?\\n2. **Remove Junk**: Uninstall anything not for workbe ruthless.\\n3. **Update Rest**: Open kept apps, check for updates, or set to auto.\\n4. **Make Rules**: Work apps only, keep them updated.\\n5. **Use Tools**: Try Jamf (Mac) or Intune for control.\\n\\nManaging apps is like tidying upit takes a little time but prevents big messes. Start now!\"\n            },\n            {\n                \"text\": \"D) Im not sure.\",\n                \"points\": 2,\n                \"feedback\": \"Not knowing what apps are around is like not checking your stockyou might have risks lurking. Unused apps can be trouble spots.\\n\\n**Steps to Fix This**:\\n1. **Check Devices**: Settings > Appssee whats installed.\\n2. **Remove Extras**: Uninstall anything unrecognized or unused.\\n3. **Ask Team**: Any non-work apps on your devices?clean them up.\\n4. **Set Policy**: Work apps only.\\n5. **Use CCleaner**: It helps spot and ditch unused apps.\\n\\nTaking charge of apps is like a spring cleanits refreshing and safer. Check it out today!\"\n            }\n        ]\n    },\n    {\n        \"id\": 11,\n        \"category\": \"Email Safety\",\n        \"question\": \"Do you have anything in place to stop fake or scam emails from reaching your inbox?\",\n        \"answers\": [\n            {\n                \"text\": \"A) Yes, we use a tool that catches most scam emails.\",\n                \"points\": 10,\n                \"feedback\": \"Great job! A scam-filtering tool is like a guard at your gateit stops most trouble before it gets in. Phishing emails are a top threat, and this keeps them at bay. To keep it strong:\\n\\n- **Update It**: Ensure your tools software is currentcheck settings or ask your provider.\\n- **Check Settings**: In Google Workspace or Microsoft 365, confirm advanced spam protection is on.\\n- **Train Staff**: Remind your team to flag odd emailssome might slip through.\\n\\nYoure doing awesome at blocking scamskeep it up, and youre well-guarded!\"\n            },\n            {\n                \"text\": \"B) Yes, but just the basic spam filter with our email.\",\n                \"points\": 4,\n                \"feedback\": \"Youve got something, but a basic spam filter is like a flimsy screen doorit catches big stuff, but clever scams sneak through. Phishing emails often bypass these, like one in 2020 that cost a business $10,000 via a fake invoice.\\n\\n**Steps to Fix This**:\\n1. **Upgrade Filtering**: Ask your email provider for advanced optionsGmail: Enhanced scanning; Outlook: Advanced Threat Protection.\\n2. **Add a Tool**: Try SpamTitan or Barracudaaffordable and strong.\\n3. **Train Team**: Teach red flagsurgency, weird senders, money requests.\\n4. **Set Alerts**: Enable login or activity alerts if available.\\n5. **Test It**: Use GoPhish to send a fake emaildoes it catch it?\\n\\nBoosting your filter stops more scamsits a small step for big safety!\"\n            },\n            {\n                \"text\": \"C) No, we dont have anything special.\",\n                \"points\": 0,\n                \"feedback\": \"This is a danger zone! No scam protection is like an open mailboxhackers can drop in phishing emails anytime. A business owner lost their system to a fake reset password email with no filter to stop it.\\n\\n**Steps to Fix This**:\\n1. **Enable Basics**: In Gmail or Outlook settings, turn on any spam filters.\\n2. **Ask Provider**: Call themWhat scam protection can I add?\\n3. **Add a Tool**: Try SpamTitan or Proofpointeasy for small businesses.\\n4. **Train Staff**: Use Googles Phishing Quiz to spot fakes.\\n5. **Set Rules**: If its odd and asks for info, dont clickcheck first.\\n\\nAdding protection is like locking your mailboxits simple and stops trouble. Do it today!\"\n            },\n            {\n                \"text\": \"D) Im not sure what we have.\",\n                \"points\": 2,\n                \"feedback\": \"Not knowing your email protections is like not checking your locksyou might be safe, or not. Scam emails are a huge risk without filters.\\n\\n**Steps to Fix This**:\\n1. **Check Settings**: Log into emaillook for spam or security options.\\n2. **Ask Provider**: What scam protection do we have?get details.\\n3. **Look at Inbox**: Lots of junk? Your filters weakupgrade it.\\n4. **Add a Tool**: If basic, try SpamTitan for better blocking.\\n5. **Train Team**: Teach caution with odd emails.\\n\\nChecking your defenses is like testing your alarma quick look keeps you safer. Find out now!\"\n            }\n        ]\n    },\n    {\n        \"id\": 12,\n        \"category\": \"Device Protection\",\n        \"question\": \"Do all your computers and phones have software to catch viruses or harmful programs?\",\n        \"answers\": [\n            {\n                \"text\": \"A) Yes, and we keep it running and updated.\",\n                \"points\": 10,\n                \"feedback\": \"Superb! Virus protection on all devices is like a watchdogit catches threats before they bite. To keep it fierce:\\n\\n- **Auto-Update**: Windows Defender updates with Windows; for Norton or McAfee, check settings for automatic updates.\\n- **Scan Monthly**: Run a full scanWindows: Virus & Threat Protection > Full Scan.\\n- **Protect Phones**: Use Lookout or Bitdefender Mobile (app store)keep it updated.\\n\\nYoure doing a top-notch job keeping devices safekeep it rolling, and youre golden!\"\n            },\n            {\n                \"text\": \"B) Yes, but we dont check if its working.\",\n                \"points\": 4,\n                \"feedback\": \"Good start, but not checking your virus software is like having a guard dog you dont feedit might not bark when needed. Outdated or broken software misses new threats, like ransomware that hit a business in 2018 because their antivirus hadnt updated.\\n\\n**Steps to Fix This**:\\n1. **Check Status**: Open your software (e.g., Windows Defender)is last updated recent?\\n2. **Enable Updates**: In settings, turn on automatic updates.\\n3. **Run a Scan**: Do a full scan nowcatch anything lurking.\\n4. **Set Reminders**: Check monthlyIs it running and current?\\n5. **Add to Phones**: Ensure work phones have an app like Avastcheck it too.\\n\\nKeeping it active and updated ensures your guards awakeits a quick fix for big protection!\"\n            },\n            {\n                \"text\": \"C) No, we dont use anything like that.\",\n                \"points\": 0,\n                \"feedback\": \"This is a red alert! No virus protection is like leaving your doors unlockedmalware can stroll in. A bakery lost customer card info to malware on an unprotected system, facing lawsuits and costs.\\n\\n**Steps to Fix This**:\\n1. **Install Freebies**: Windows: Settings > Update & Security > Windows Security > turn on Real-time protection. Mac: XProtect runs if updated.\\n2. **Add to Phones**: Get Avast Mobile Security (free) for work phones.\\n3. **Set Updates**: Enable auto-updates in the software.\\n4. **Scan Now**: Run a full scan to check for threats.\\n5. **Tell Team**: Keep it ondont ignore alerts.\\n\\nAdding protection is like locking upits basic and vital. Start today, and youre safer!\"\n            },\n            {\n                \"text\": \"D) I dont know if we have it.\",\n                \"points\": 2,\n                \"feedback\": \"Not knowing about virus protection is like not checking your alarmyou might be covered, or not. Its essential to stop harmful programs.\\n\\n**Steps to Fix This**:\\n1. **Check PCs**: Windows: Settings > Windows SecurityVirus & threat protection on? Mac: Security & Privacy > Gatekeeper enabled?\\n2. **Look for Icons**: Taskbar or menusee a shield (Defender) or other antivirus?\\n3. **Ask IT**: Do we have virus software on all devices?\\n4. **Install If Missing**: Use Cs stepsWindows Defender or Avast.\\n5. **Standardize**: Ensure new devices get it too.\\n\\nChecking this is like testing seatbeltsa small step for big safety. Find out today!\"\n            }\n        ]\n    },\n    {\n        \"id\": 13,\n        \"category\": \"Network Safety\",\n        \"question\": \"Is your business Wi-Fi locked with a password so only your team can use it?\",\n        \"answers\": [\n            {\n                \"text\": \"A) Yes, with a strong password we keep private.\",\n                \"points\": 10,\n                \"feedback\": \"Excellent! A strong, private Wi-Fi password is like a tall fenceit keeps intruders out. To keep it secure:\\n\\n- **Strong Password**: At least 12 characters, mixed types (e.g., W1F1!S3cur3!2023).\\n- **Change Yearly**: Update it annually or if compromised.\\n- **Update Router**: Check the manufacturers site for firmware updatesinstall them.\\n- **Separate Guests**: Use a guest network for visitors.\\n\\nYoure doing great keeping your network lockedkeep it up, and youre safe!\"\n            },\n            {\n                \"text\": \"B) Yes, but its simple or shared with others.\",\n                \"points\": 4,\n                \"feedback\": \"Youve got a lock, but a simple or shared password is like a flimsy gateeasy to crack. A caf\\xe9s cafe123 password let hackers steal customer info. Weak or public passwords invite trouble.\\n\\n**Steps to Fix This**:\\n1. **New Password**: Make it 12+ characters (e.g., C0ff33!W1F1!2023).\\n2. **Keep It Private**: Dont share with non-staffset a guest network instead.\\n3. **Change It**: Log into your router (192.168.1.1), Wireless Settings, update password.\\n4. **Use WPA3**: If available, switch to WPA3 in security settings.\\n5. **Share Smart**: Give staff the password securelye.g., via a manager tool.\\n\\nStrengthening your Wi-Fi locks out hackersits a quick fix for big safety!\"\n            },\n            {\n                \"text\": \"C) No, anyone can connect.\",\n                \"points\": 0,\n                \"feedback\": \"This is wide open! No password is like leaving your gate unlockedanyone can use your Wi-Fi to steal data or cause legal trouble. A business faced issues when someone used their open network for illegal downloads.\\n\\n**Steps to Fix This**:\\n1. **Add a Password**: Log into router (192.168.1.1), Wireless Settings, set a strong one (see B).\\n2. **Choose WPA2/WPA3**: In security settings, pick WPA2 or WPA3not WEP.\\n3. **Hide It**: Turn off SSID broadcasting if possible.\\n4. **Guest Network**: Set one up for visitorslimit its access.\\n5. **Update Firmware**: Check manufacturers site for updates.\\n\\nLocking your Wi-Fi is like securing your yardits basic and vital. Do it today!\"\n            },\n            {\n                \"text\": \"D) Im not sure if its locked.\",\n                \"points\": 2,\n                \"feedback\": \"Not knowing if your Wi-Fis locked is like not checking your fenceyou might be safe, or not. Open networks are a hackers playground.\\n\\n**Steps to Fix This**:\\n1. **Check Router**: See if it lists a passwordnone means its open.\\n2. **Test It**: Search Wi-Fi on a deviceconnects without a password? Its open.\\n3. **Log In**: 192.168.1.1, admin login (try admin/password), check Wireless Settings.\\n4. **Lock It**: Set a strong password if needed (see B).\\n5. **Ask Provider**: Is my Wi-Fi secure?they can help.\\n\\nChecking this is like locking up at nighta small step for big safety. Find out now!\"\n            }\n        ]\n    },\n    {\n        \"id\": 14,\n        \"category\": \"Handling Problems\",\n        \"question\": \"Do you have a plan for what to do if something goes wrong, like a hack or lost data?\",\n        \"answers\": [\n            {\n                \"text\": \"A) Yes, weve got a clear plan and know who to call.\",\n                \"points\": 10,\n                \"feedback\": \"Brilliant! A clear plan is like a fire drillit gets you out of trouble fast. To keep it sharp:\\n\\n- **Review Yearly**: Update it after staff or system changes.\\n- **Practice It**: Run a drill annuallypretend its a hack and follow steps.\\n- **Share Roles**: Ensure everyone knows their parte.g., who calls IT.\\n\\nYoure ready for anythingkeep it up, and youll handle crises like a pro!\"\n            },\n            {\n                \"text\": \"B) We have an idea, but its not written down.\",\n                \"points\": 4,\n                \"feedback\": \"Youre thinking ahead, but an unwritten plan is like a mental note in a stormits hard to recall when panicked. A business lost time during ransomware because they couldnt remember steps.\\n\\n**Steps to Fix This**:\\n1. **Write It**: List: 1. Disconnect devices. 2. Call IT at [number]. 3. Restore backups.\\n2. **Assign Jobs**: Who calls? Who checks backups?\\n3. **List Contacts**: IT, internet provider, insurance numbers.\\n4. **Store It**: Email it to staff or print copies.\\n5. **Review**: Update yearly.\\n\\nWriting it down keeps you calm and quickits a small step for big readiness!\"\n            },\n            {\n                \"text\": \"C) No, wed figure it out if it happens.\",\n                \"points\": 0,\n                \"feedback\": \"This is risky! No plan is like no extinguisher during a fireyoure scrambling when its too late. A business took weeks to recover from a hack because they had no roadmap.\\n\\n**Steps to Fix This**:\\n1. **Make a Plan**: Write: 1. Disconnect. 2. Call IT. 3. Restore backups.\\n2. **Find Help**: Get a local IT contactsave their number.\\n3. **Know Backups**: Learn how to access and restore them.\\n4. **Share It**: Tell your team the steps.\\n5. **Test It**: Talk through a fake incident.\\n\\nA basic plan takes an hour but saves daysstart now, and youre covered!\"\n            },\n            {\n                \"text\": \"D) I dont know if we have a plan.\",\n                \"points\": 2,\n                \"feedback\": \"Not knowing your plan is like not knowing your escape routeyou might be set, or not. Cyber incidents need quick action.\\n\\n**Steps to Fix This**:\\n1. **Ask Team**: Do we have a cyber plan?find it if yes.\\n2. **Check IT**: Whats our hack plan?get details.\\n3. **Make One**: If none, use Cs stepssimple list.\\n4. **Share It**: Give it to key staff.\\n\\nA plan is like a map in chaosa quick check gets you ready. Find out today!\"\n            }\n        ]\n    },\n    {\n        \"id\": 15,\n        \"category\": \"Device Safety\",\n        \"question\": \"Do your work computers and phones lock automatically when not in use?\",\n        \"answers\": [\n            {\n                \"text\": \"A) Yes, they all lock with passwords or PINs.\",\n                \"points\": 10,\n                \"feedback\": \"Perfect! Auto-locking devices is like auto-locking doorsit keeps data safe if theyre lost or stolen. To keep it tight:\\n\\n- **Strong Passwords**: Use 8+ characters (e.g., D0g!2023).\\n- **Set Timeout**: Lock after 5 minutesWindows: Settings > Personalization > Lock screen; Phones: Settings > Display.\\n- **Encrypt**: Windows: Settings > Device Encryption (BitLocker); Mac: FileVault in Security & Privacy.\\n- **Add Biometrics**: Use fingerprint or face ID on phones.\\n\\nYoure nailing device securitykeep it up, and youre rock-solid!\"\n            },\n            {\n                \"text\": \"B) Some lock, but not all.\",\n                \"points\": 4,\n                \"feedback\": \"Youre halfway, but unlocked devices are like an open back doorthieves can grab data. A business lost client info when an unlocked laptop was stolen from a car.\\n\\n**Steps to Fix This**:\\n1. **Check Devices**: List work PCs and phonesdo they lock?\\n2. **Add Locks**: Windows: Settings > Accounts > Sign-in options > Password. Phones: Settings > Security > Screen lock.\\n3. **Set Auto-Lock**: 5 minutes on PCs; 1 minute on phones.\\n4. **Encrypt**: Turn on BitLocker or FileVault.\\n5. **Tell Team**: Ensure all devices lock.\\n\\nLocking everything keeps data safeits a quick fix for big protection!\"\n            },\n            {\n                \"text\": \"C) No, they stay unlocked.\",\n                \"points\": 0,\n                \"feedback\": \"This is a big risk! Unlocked devices are like leaving your car runninganyone can take off with your data. A phone left at a caf\\xe9 sent fake invoices because it had no lock.\\n\\n**Steps to Fix This**:\\n1. **Set Passwords**: PCs: Settings > Accounts > Sign-in options. Phones: Settings > Security > Screen lock.\\n2. **Make Them Strong**: 8+ characters, mixed types.\\n3. **Auto-Lock**: PCs: 5 minutes. Phones: 1 minute.\\n4. **Encrypt**: Use BitLocker or FileVault.\\n5. **Train Staff**: Lock devices when awayCtrl+Alt+Delete (Windows) or Cmd+Q (Mac).\\n\\nLocking up is like securing your keyssimple and vital. Start now!\"\n            },\n            {\n                \"text\": \"D) Im not sure if they lock.\",\n                \"points\": 2,\n                \"feedback\": \"Not knowing if devices lock is like not checking your shop at nightyou might be safe, or not. Unlocked devices are a risk.\\n\\n**Steps to Fix This**:\\n1. **Check Them**: PCs: Settings > Accountspassword set? Phones: Settings > Security.\\n2. **Test It**: Leave idledoes it lock after 5 minutes?\\n3. **Ask Team**: Do your devices lock?fix any nos.\\n4. **Set Policy**: All devices must lock.\\n\\nChecking locks is like zipping your walleta small step for safety. Find out today!\"\n            }\n        ]\n    },\n    {\n        \"id\": 16,\n        \"category\": \"Company Policies\",\n        \"question\": \"Do your written policies include specific rules about using company devices, running apps, or getting cybersecurity training?\",\n        \"answers\": [\n            {\n                \"text\": \"A) Yes, our policies cover these details clearly (e.g., no personal apps, mandatory training).\",\n                \"points\": 10,\n                \"feedback\": \"Great job! Clear, specific policies are like road signsthey guide your team to safe choices. To keep them effective:\\n\\n- **Review Yearly**: Update for new risks (e.g., AI tools).\\n- **Get Sign-Off**: Have staff read and signuse a quiz for fun.\\n- **Enforce It**: Gently remind rule-breakers why it matters.\\n\\nYoure setting a strong standardkeep it up, and your teams on track!\"\n            },\n            {\n                \"text\": \"B) We have policies, but theyre general and dont mention these specifics.\",\n                \"points\": 4,\n                \"feedback\": \"Youve got a base, but vague policies are like blurry signshard to follow. Without specifics, staff might install risky apps or skip training. A business had a breach because an employees app wasnt banned.\\n\\n**Steps to Fix This**:\\n1. **Add Rules**: Write: No personal apps, Yearly training required, Work devices for work only.\\n2. **Keep It Simple**: Plain Englishe.g., No games on work PCs.\\n3. **Share It**: Email the updateexplain why.\\n4. **Enforce**: Remind violators of the risk.\\n5. **Update Yearly**: Add new rules as needed.\\n\\nSpecifics give clear directionits an easy tweak for better safety!\"\n            },\n            {\n                \"text\": \"C) No, we dont have written policies yet.\",\n                \"points\": 0,\n                \"feedback\": \"This is a gap! No policies is like no rules in a gameeveryone guesses, and risks rise. An employees illegal download on a work laptop cost a business bigno policy stopped it.\\n\\n**Steps to Fix This**:\\n1. **Write Basics**: One page: Work devices for work, Yearly training, No unapproved apps.\\n2. **Ask Team**: Does this work?get feedback.\\n3. **Share It**: Email it, keep a copy handy.\\n4. **Get Signatures**: Staff sign to confirm theyve read it.\\n5. **Grow It**: Add rules as you go.\\n\\nPolicies are like house rulessimple to start, big impact. Do it today!\"\n            },\n            {\n                \"text\": \"D) Im not sure whats in our policies.\",\n                \"points\": 2,\n                \"feedback\": \"Not knowing your policies is like having rules but not sharing themnobody follows whats unclear.\\n\\n**Steps to Fix This**:\\n1. **Find Them**: Check drives or ask HRwheres the policy?\\n2. **Read It**: Does it cover devices, apps, training?\\n3. **Update It**: Add specifics (see B)make it clear.\\n4. **Tell Team**: Share where it lives and whats in it.\\n5. **Review Date**: Set a yearly check.\\n\\nKnowing your rules is like knowing your playbooka quick look sets you straight. Check now!\"\n            }\n        ]\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/questions.ts\n");

